export const ComunicacionComponentes = (nombre, apellido, fichaMedica) => {
  console.log(nombre)
  return (
    <>
      <hr/>
        ComunicacionComponentes.js
      <hr/>
      <ul>
        <li>{nombre}</li>
        <li>{apellido}</li>

      </ul>
    </>
  )
}

ComunicacionComponentes.propTypes = {
  nombre: PropTypes.string,
  apellido: PropTypes.string,
  fichaMedica: PropTypes.object
}

export default ComunicacionComponentes;
